import styled from "styled-components";
import { useSelector } from "react-redux";
import { useEffect } from "react";

import { ComponentHeaderAuth } from "@components";
import { selectMerchant } from "@redux";
import { ModuleEmail } from "@modules";

export const PageSignUpEmailIFrom = () => {
    //page variable
    const merchant = useSelector(selectMerchant);

    useEffect(() => {}, []);

    return (
        <StyledContainer color={merchant.themeColor}>
            <ComponentHeaderAuth />
            <ModuleEmail />
        </StyledContainer>
    );
};

const StyledContainer = styled.div<{ color: string }>``;
